    false,nt"url": null,nt"notes": "This annual narrative report for Seedskadee
    National Wildlife Refuge outlines Refuge accomplishments during the 1992 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, forests, croplands,
    grasslands, grazing, fire management, pest control, water rights, and wilderness
    areas. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, animal control, and marking and bird banding.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, and equipment replacement. Items
    of interest are provided at the end. Refuge brochures and field guides are attached.",nt"license_title":
